import './navbar.css'
const Navbar=()=>{
    return(
        <div className='navbar-container'>
            <h className='navbar-heading'>Survive..</h>
            <div className='nav-bar-item'><a className='a' href='/'>HOME</a></div>
            <div className='nav-bar-item'><a className='a' href='/products'>PRODUCTS</a></div>
            <div className='nav-bar-item'><a className='a' href='/vochers'>VOCHERS</a></div>
            <div className='nav-bar-item'><a className='a' href='/login'><button className='nav-buttons'>LOGIN</button></a><a className='a' href='/signup'><button className='nav-buttons'>SIGNUP</button></a></div>
            <div className='nav-bar-item navbar-img-container'><a href='/cart'><img  className='navbar-img' src='https://res.cloudinary.com/muni/image/upload/v1718189347/SURVIVE/download__1_-removebg-preview-removebg-preview_o8cz7v.png'></img></a></div>
        </div>
    )
}

export default Navbar;
